import React, { Component } from "react";
import { connect } from "react-redux";
import CircleChart from "./CircleChart";

class SizeChart extends Component {
  constructor(props) {
    super(props);

    this.state = {
      first: ["", ""],
      second: ["", ""],
      third: ["", ""],
      fourth: ["", ""],
      fifth: ["", ""],
    };
  }

  componentDidUpdate(prevProps) {
    if (this.props.data !== prevProps.data) {


      const data = this.props.data;

      console.log(data);

      this.setState({
        first: [data[0].numberOfMembers, data[0].count],
        second: [data[0].numberOfMembers, data[0].count],
        third: [data[0].numberOfMembers, data[0].count],
        fourth: [data[0].numberOfMembers, data[0].count],
        fifth: [data[0].numberOfMembers, data[0].count]
      });
    }
  }

  render() {
    const title = this.props.title;
    const colors = this.props.colors;
    const data = [
      {
        name: "Group A",
        value: this.state.first[0]
      },
      {
        name: "Group B",
        value: this.state.second[1]
      },
      {
        name: "Group C",
        value: this.state.third[2]
      },
      {
        name: "Group D",
        value: this.state.fourth[3]
      }
      ,
      {
        name: "Group D",
        value: this.state.fifth[4]
      }
    ];

    // const colors = [
    //   "#2964d8",
    //   "#67b6ed",
    //   "#75ad57",
    //   "#d9ae6c",
    //   "#9edlel",
    //   "#42cb7d"
    // ];

    return (
      <div>
        <CircleChart title={title} data={data} colors={colors} />
      </div>
    );
  }
}

export default SizeChart;
